package com.example.demooooo.mapper;import com.example.demooooo.dto.UserDto;import com.example.demooooo.model.User;import org.mapstruct.Mapper;import org.mapstruct.factory.Mappers;import java.util.List;@Mapper(componentModel = "spring")public interface UserMapper {	UserMapper INSTANCE = Mappers.getMapper(UserMapper.class);	UserDto modelToDto(User user);	User dtoToModel(UserDto userDto);	List<UserDto> modelsToDtos(List<User> users);}